import React, { useEffect, useState, useRef } from "react";

import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import SvgIcon from '@mui/material/SvgIcon';
import Chip from '@mui/material/Chip';
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';

function SvgButton(props) {

  let svgList = useRef(
    {
      "blank": "",
      "menuSettings": "m2,12h20z m0,-6h20z m0,12h20z",
      "menuContext": "",
      "treeRadial": "",
      "treeRectangular": "m5,4h14zv13z m0,7h-3z  m6,6h-6zv-6zv4z m0,-6h12z m0,10h9z",
      "treeCircular": "m12,12l3.5,3.5z m-5,0h-5za5,5,0,1,0,8.5,-3.5a5,5,0,1,1,-8.5,3.5z",
      "treeDiagonal": "m2,12l18,-9zl18,9z m8,-4l10,5z",
      "treeHierarchical": "m18,5v14zh-13z m-7,0v-3z m-6,6v-6zh-6zh4z m6,0v12z m-10,0v9z"
    }
  );

  let [svg, setSvg] = useState(svgList.current["blank"]);
  let [label, setLabel] = useState("");
  let [drop, setDrop] = useState(false);

  useEffect(() => {
    setSvg(svgList.current[props.svg])
    setLabel(props.label)
    setDrop(props.drop)
  }, [])

  if (label) {
    if (drop) {
      return (
        <p>
          Chip:&nbsp;
          <Chip
            size="small"
            label={label}
            deleteIcon=<ArrowDropDownIcon />
            onDelete={() => {}}
            sx={{backgroundColor: "#ddd", boxShadow: "-1px 1px 1px rgba(0, 0, 0, .5)", "&:hover": {boxShadow: "-1px 1px 2px rgba(0, 0, 0, .7)", backgroundColor: "#eee", cursor: "pointer"}}}
            icon=<SvgIcon>
              <path stroke="dimgray" fill="transparent" stroke-width="2" stroke-linejoin="round" d={svg}></path>
            </SvgIcon>
            clickable
            disableRipple={false}
            centerRipple={false}
          />
        </p>
      )
    } else {
      return (
        <p>
          Chip:&nbsp;
          <Chip
            size="small"
            label={label}
            sx={{backgroundColor: "#ddd", boxShadow: "-1px 1px 1px rgba(0, 0, 0, .5)", "&:hover": {boxShadow: "-1px 1px 2px rgba(0, 0, 0, .7)", backgroundColor: "#eee", cursor: "pointer"}}}
            icon=<SvgIcon>
              <path stroke="dimgray" fill="transparent" stroke-width="2" stroke-linejoin="round" d={svg}></path>
            </SvgIcon>
            clickable
            centerRipple={false}
          />
        </p>
      )
    }
  } else {
    return (
      <p>
        SvgButton:&nbsp;
        <IconButton centerRipple={false} size="small" onClick={() => {}} sx={{height: 24, width: 24, backgroundColor: "#ddd", boxShadow: "-1px 1px 1px rgba(0, 0, 0, .5)", "&:hover": {boxShadow: "-1px 1px 2px rgba(0, 0, 0, .7)", backgroundColor: "#eee"}}}>
          <SvgIcon sx={{height: 16, width:16}}>
            <path stroke="dimgray" fill="transparent" stroke-width="2" stroke-linecap="round" d={svg}></path>
          </SvgIcon>
        </IconButton>
      </p>
    )
  }
}

export default SvgButton;
